import React, { Component } from 'react';
import {  } from 'reactstrap';


class Modules extends Component{



 render(){
    const modules = this.props.datas.map((data) => {
      return (
        <div key={data.id} className="jumbotron">



          <h3>{data.name}</h3>
          <h5>{data.category}</h5> 
          <p>{data.label}</p>
          <p>{data.price}</p>
          <p>{data.description}</p>


        </div>


      );
    });

	  return(
      <div className="container">
        <div className="row">
        <div className="col-12">

          {modules}
          </div>
        </div>
      </div>




    );
  }
}

export default Modules;
